"""**Пересечение множеств (&):**

При пересечении создаётся новое множество, содержащее все элементы,
общие для обоих (без дубликатов).
"""

set_1 = {"hello", 2, 3, 4}
set_2 = {"hello", 3, 4, 5, 6}
print(set_1 & set_2)

"""**Вычитание множеств (-):**

При использовании разности создаётся новое множество, включающее
элементы, которые есть в первом, но не входят во второй.
"""

set_1 = {"hello", 2, 3, "qwerty", 4}
set_2 = {3, 4, 5, "hello", 6, 7}

print(set_2 - set_1)

"""**Симметричное вычитание множеств (^):**

Создаётся новый объект, включающий все элементы, за исключением тех,
которые есть в обоих.
"""

set_1 = {1, "Vadim", 3, 6, 4, 5}
set_2 = {3, 5, "hello", 6, 7, 8}

print(set_1 ^ set_2)

"""**Методы множеств:**

У множеств достаточно много разных методов:

* `.isdisjoint(other)` - возвращает True, если множество и other не имеют общих значений
"""

set_1 = {1, 2, 3, 10, 4, 5}
set_2 = {5, 6, 7, 8, 9, 10}

print(set_1.isdisjoint(set_2))

"""* `.issubset(other)` - вернёт True, если множество является подмножеством для other"""

set_1 = {10, "Vova"}
set_2 = {1, 2, 3, "a", "b", 7, 5, 9}

print(set_1.issubset(set_2))

"""* `issuperset(other)` - вернёт True, если множество является надмножеством для other"""

set_1 = {"b", 7, 5}
set_2 = {1, 2, 3, "a", "b", 7, 5, 9}

print(set_1.issuperset(set_2))

"""* `union(other_1, other_2)` - объединяет несколько множеств. Аналогично (|)"""

female_students = {"Anna", "Nicka", "Valeria", "Kristin", "Maria"}
male_students = {"David", "Mike", "Nicka", "Adrey", "John", "Kristin", "Sumit"}

hight_school_students = set.union(female_students, male_students)

print(hight_school_students)

print(female_students.union(male_students))

"""* `intersection(other)` - вернёт пересечение множеств. Аналогично (&)"""

set_1 = {"hello", 2, 3, 4}
set_2 = {"hello", 3, 4, 5, 6}
set_3 = set.intersection(set_1, set_2)
print(set_3)

"""* `difference(other)` - вернёт множетво с элементами, не принадлежащими ни одному из other. Аналогично (-)"""

set_1 = {"hello", 2, 3, "qwerty", 4}
set_2 = {3, 4, 5, "hello", 6, 7}
print(set_1.difference(set_2))

"""* `copy()` - создаёт копию множества"""

sentitive_data = {12312353, 3454542, 443234, 6897655, 23456, 987654}

copy_of_data = set.copy()
print(copy_of_data)

id(sentitive_data)

id(copy_of_data)

"""Приведённые выше методы не работают с frozenset, кортежами и списками.


Так же есть методы, которые не возвращают нам новое множество, как было выше, а изменяют наш текущий set ( так как наш set - изменяемый тип данных ):

* `add()` - добавляет новый элемент в множество
"""

set_1 = {1, 2, 3, 4}

set_1.add("l")

print(set_1)

set_1.add("vlad")
print(set_1)

"""* `remove()` - удаляет элемент из множества. KeyError, если элемента во множестве нет."""

set_1 = {5, 6, 7, 8, 9}

# set_1.remove(7)

print(set_1)

# set_1.remove("vlad")

"""* `discard()` - аналог метода remove, только если элемента не найдено - ничего."""

set_1.discard("vlad")

"""* `pop()` - удаляет и возвращает элемент из множества. Так как элементы во множестве неупорядоченные, нельзя предугодать какой элемент будет удалён."""

set_1 = {"a", "b", 1, 2, frozenset((7, 8, 9))}

a = set_1.pop()

print(set_1)
print(a)

"""* `clear()` - очищает множество"""

set_1.clear()

print(set_1)

